import React from 'react'
import styled from 'styled-components'

const Me: React.FC = () =>{

    return(
        <StyledContainer>
            <StyledHeader>About me</StyledHeader>
        </StyledContainer>
    )
}

const StyledHeader = styled.h3`
    text-align: center;
`

const StyledContainer = styled.div`
display: flex;
flex-flow: column;
margin-left: auto;
margin-right: auto;
border-radius: 4px;
justify-content: center;
width: 80%;
height: 90%;
background-color: #008B8B;
`
export default Me;
